var tipuesearch = {"pages": [{'title': 'About', 'text': '??? \n', 'tags': '', 'url': 'About.html'}, {'title': '托福、GRE', 'text': '', 'tags': '', 'url': '托福、GRE.html'}, {'title': '托福', 'text': '托福考試多為申請國外/美國大學研究所的必備門檻之一，而托福考試內容皆取材於真實的情境，取材自不同的美國教育機構，包括大學和研究所階段的教育資料，涵蓋教科書中的知識範疇涉及教育、人文、商業、工程、自然科學和社會研究等六大領域，以及各種校園生活情境模擬，讓考生在準備托福考試的過程中能夠預先培養美式教育注重的通才觀念，以及邏輯整合的思辨能力。 \n', 'tags': '', 'url': '托福.html'}, {'title': 'GRE', 'text': 'GRE-Graduate Record Examinations美國研究生入學考試/資格考試，為美國教育測驗服務社ETS所研發、舉辦一套系統考試， 採機上測驗、適性化測驗 ，GRE主要是用來檢測考生對於大學知識的吸收多寡，整體重視考生對於情境的理解能力、考生分析推理的能力。 GRE考試共可分為分析寫作Analytical Writing、語文Verbal、計量Quantitative三大項目 \n test \n \n', 'tags': '', 'url': 'GRE.html'}, {'title': 'sakmata', 'text': '', 'tags': '', 'url': 'sakmata.html'}]};